import React from 'react'
import { Form } from 'antd'

const NewPost = () => {
    return(
        <h1>Create New Post Here</h1>
    )
}

const LivingPostList = () => {
    return (
        <h1>Living Commodity List</h1>
    )
}



const PostCommodity = () => {
    return(
        <div>
            <NewPost />
            <LivingPostList />
        </div>
    )
}

export default PostCommodity
